INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.029, 110, 1, 160, 1, 122601, 1, 0, 1.5, 0, 1, 101, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.014, 105, 2, 120, 2, 122401, 3, 0, 2.5, 1, 0, 102, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 111);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.017, 110, 3, 350, 3, 122501, 2, 1, 2.5, 0, 0, 103, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.016, 110, 4, 130, 4, 107501, 3, 0, 1.5, 1, 0, 104, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.014, 110, 5, 160, 5, 107601, 1, 0, 2.5, 0, 1, 105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.029, 120, 6, 255, 6, 107801, 2, 1, 3.5, 0, 0, 106, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.013, 120, 7, 160, 7, 110601, 1, 0, 3.5, 0, 1, 107, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.014, 110, 8, 350, 8, 110401, 2, 1, 2.5, 0, 0, 108, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.012, 105, 9, 130, 9, 110501, 3, 0, 1.5, 1, 0, 109, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 100);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.014, 105, 10, 200, 10, 115701, 1, 0, 2.5, 0, 1, 110, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.071, 105, 11, 350, 11, 113601, 2, 1, 2.5, 0, 0, 111, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.014, 120, 12, 130, 12, 107901, 3, 0, 1.5, 1, 0, 112, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.022, 110, 13, 200, 13, 108001, 2, 0, 1.5, 0, 1, 113, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.031, 110, 14, 160, 14, 110301, 1, 0, 2.5, 0, 1, 114, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 108);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.036, 110, 15, 130, 15, 107701, 1, 0, 0.5, 1, 0, 115, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.048, 110, 16, 350, 16, 113101, 2, 1, 3.5, 0, 0, 116, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 95);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.043, 105, 17, 130, 17, 113301, 3, 0, 1.5, 1, 0, 117, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.018, 105, 18, 130, 18, 113201, 2, 0, 1.5, 1, 0, 118, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 95);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.021, 110, 19, 160, 19, 117001, 2, 0, 2.5, 0, 1, 119, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 108);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.036, 110, 20, 255, 20, 113501, 1, 1, 2.5, 0, 0, 120, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.02, 105, 21, 350, 21, 113401, 3, 1, 2.5, 0, 0, 121, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.018, 110, 22, 130, 22, 110101, 1, 0, 2.5, 1, 0, 122, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.03, 105, 23, 160, 23, 110001, 3, 0, 3.5, 0, 1, 123, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 111);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.027, 110, 24, 130, 24, 117201, 1, 0, 1.5, 1, 0, 124, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 103);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.02, 105, 25, 160, 25, 117301, 2, 0, 3.5, 0, 1, 125, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 108);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.04, 110, 26, 350, 26, 117401, 3, 1, 2.5, 0, 0, 126, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.009, 110, 27, 350, 27, 117101, 1, 1, 3.5, 0, 0, 127, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.022, 120, 28, 255, 28, 122901, 1, 1, 3.5, 0, 0, 128, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.028, 110, 29, 130, 29, 122801, 3, 0, 2.5, 1, 0, 129, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 105);
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (0.023, 105, 30, 130, 30, 122701, 2, 0, 3.5, 0, 1, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 108);
